import React from 'react';
import { IonList, IonItem, IonSelect, IonSelectOption } from '@ionic/react';
import { IMedication } from 'pages/Home';

/* interface SelectMedicationProps {
  name: string;
} */

function SelectMedication() {
  const renderMedication = (item: IMedication) => (
    <IonItem>
      <IonItem>
        <IonSelect interface="popover" placeholder={'Medicamento'}>
          <IonSelectOption value="apples">Apples</IonSelectOption>
          <IonSelectOption value="oranges">Oranges</IonSelectOption>
          <IonSelectOption value="bananas">Bananas</IonSelectOption>
        </IonSelect>
      </IonItem>{' '}
    </IonItem>
  );
  return (
    <IonList>
      <IonItem>
        <IonSelect interface="popover" placeholder={'Medicamento'}>
          <IonSelectOption value="apples">Apples</IonSelectOption>
          <IonSelectOption value="oranges">Oranges</IonSelectOption>
          <IonSelectOption value="bananas">Bananas</IonSelectOption>
        </IonSelect>
      </IonItem>
    </IonList>
  );
}
export default SelectMedication;

